import fs from 'fs'

export default (req, res) => {
    res.statusCode = 200
    res.setHeader('Content-Type', 'application/json')
    res.end(JSON.stringify({ name: 'John Doe' }))

    fs.readFile('/Users/lsmienk/status.txt', 'utf8', function(err, lorena) {
        console.log('file', lorena);
    })
}
